INSERT INTO `komentars` (`id`, `user_id`, `laporan_id`, `komentar`, `created_at`, `updated_at`, `file`) VALUES
(1, 51, 37, 'Laporan telah di tindaklanjuti,', '2022-06-12 03:11:30', '2022-06-12 03:11:30', NULL),
(2, 187, 42, '-', '2022-07-10 04:46:50', '2022-07-10 04:46:50', NULL),
(3, 193, 44, 'Harap di DinkopUM Lamongan bisa memilah mana email masuk mana spam, apa memang tdk ada petugas yg sesuai kompetensi tsb ?\r\nMohon dicermati, judul kami sudah jelas\r\nBilamana dinyatakan tdk jelas, kami minta diberikan SOP, Surat Edaran, atau sosialisasi resmi dari DinkopUm', '2022-09-02 04:32:40', '2022-09-02 04:32:40', NULL),
(4, 193, 44, 'Menanggapi tindak lanjut 5 Sept 2022 dr Bapak Inspektur, kami sampaikan bahwasanya kami email 12 Agustus 2022 dg akun email kami sotoayam.djijaya@gmail.com . Sedangkan di aplikasi ini tdk ada fitur upload file, screenshot akan kami kirim ke CP Bapak Inspektur kalau berkenan', '2022-09-06 01:27:43', '2022-09-06 01:27:43', NULL),
(5, 193, 44, 'Menanggapi Tindak Lanjut 6 Sept 2022 di aplikasi ini\r\nJadi yg tercantum Bpk Nazaruddin dlm Tindak Lanjut ini sbg Inspektur atau admin Inspektorat yg mewakili Inspektur\r\nSaya hanya menanggapi berdasarkan apa yg tercantum', '2022-09-09 11:39:22', '2022-09-09 11:39:22', NULL);
