(36, NULL, 2, 1, 1, 9, NULL, 'LA0000020220608140440', 'Pengurusan Pkkpr untuk izin PBG Di Kab. Lamongan yang penerbitannya terkendala Keputusan Menteri Negara Agraria/ Kepala Badan Pertanahan Nasional Nomor 1589/sk-hk.02.01/xii/2021 Tahun 2021', 'pengurusan-pkkpr-untuk-izin-pbg-di-kab-lamongan-yang-penerbitannya-terkendala-keputusan-menteri-negara-agrariakepala-badan-pertanahan-nasional-nomor-1589sk-hk0201xii2021-tahun-2021-lotznbiodecavu0q', 'jepet17@gmail.com', '<p><span style=\"color: rgb(51, 51, 51);\">Bismillahirrohmanirrohim</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Pekenalkan nama saya david effendi dari yayasan insan bakti madani indonesia</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Yayasan kami berniat melakukan pengurusan pbg untuk pembangunan gedung sekolah tk di lamongan, namun mendapatkan balasan belum bisa di proses dengan alasan lahan kami adalah lsd dengan dasar dari ptsp lamongan sebagai berikut :</span></p><p><span style=\"color: rgb(51, 51, 51);\">- keputusan menteri negara agraria/kepala badan pertanahan nasional nomor 1589/sk-hk.02.01/xii/2021 tahun 2021 tanggal 24 des 2022</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Namun menurut notaris serta perda rtrw lamongan yg di rilis untuk tahun 2020-2039 harusnya lahan kami di proyeksi sebagai pemukiman, dengan dasar sebagai berikut:</span></p><p><span style=\"color: rgb(51, 51, 51);\">- perda kab. Lamongan no 3 tahun 2021 tentang rencana tata ruang wilayah kabupaten lamongan tahun 2020-2039</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Yang menjadi pertanyaan kami,</span></p><p><span style=\"color: rgb(51, 51, 51);\">1. Kapan kami bisa mengurus pkkpr,?</span></p><p><span style=\"color: rgb(51, 51, 51);\">2. Apakah sk menteri tersebut tidak memperbolehkan pertek bpn untuk pkkpr perkim sebagai dasar pengurusan pbg?</span></p><p><span style=\"color: rgb(51, 51, 51);\">3. Info dari perkim sk. Menteri harus di klarifikasi oleh tim terpadu dan kapan batas waktu klarifikasi lahan lsd tersebut?</span></p><p><span style=\"color: rgb(51, 51, 51);\">4. Apa ada solusi agar kami tetap bisa melanjutkan proses kepengurusan pbg? Karena sebagai warga negara yang baik kami ingin mengikuti peraturan pemerintah.</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\">Lampiran</span></p><p><span style=\"color: rgb(51, 51, 51);\">1. Surat balasan dari ptsp lamongan</span></p><p><span style=\"color: rgb(51, 51, 51);\">2. Perda rtrw lamongan https://tataruang.atrbpn.go.id/protaru/upload/rtrwt52/perda%20rtrw%20nomor%203%20tahun%202021.pdf</span></p><p><span style=\"color: rgb(51, 51, 51);\">3. Sk menteri atr https://jdih.atrbpn.go.id/klaster_detail/9</span></p><p><br></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">Informasi tambahan</span></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">1. Pendaftaran kami untuk PKKPR adalah tgl 21 april 2022</span></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">2. Pertek BPN tanah kami terbit tgl 28 April menyatakan lahan kami adalah lahan pemukiman sesuai RTRW lamongan th 2020-2039</span></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">3. Tgl 19 Mei 2022 Kami dipanggil oleh PTSP didampingi tim dari Perkim Lamongan menyatakan bahwa perizinan kami *Belum Bisa Di Proses* atas dasar info dari perkim,</span></p><p><br></p><p><span style=\"color: rgb(34, 34, 34);\">Nb ada beberapa PKKPR yang terbit setelah SK menteri 24 Des terbit, ada PBG bulan april 2022 yang terbit, sedangkan milik kami belum ada kejelasan.</span></p><p><br></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">Mohon dibantu informasi bagaimana alur kami agar bisa melakukan kepengurusan PKKPR untuk kegiatan non berusaha</span></p><p><br></p><p><span style=\"color: rgb(74, 74, 74); background-color: rgb(217, 237, 247);\">Terima Kasih</span></p>', '2022-06-08', 'DPMPTSP Kab. Lamongan', 10, 2, NULL, 0, 0, 1, '{\"1\":\"2022-06-08 14:04:40\",\"3\":\"2022-06-08 15:22:42\",\"5\":\"2022-06-09 07:23:00\",\"8\":\"2022-06-09 08:08:02\",\"10\":\"2022-08-16 14:17:09\"}', '2022-06-08 07:04:40', '2022-08-16 07:17:09'),
