(5120, 236, 2, 1, 2, 10, NULL, 'LA0023620230428143547', 'Pengaduan', 'pengaduan-hxkepvfgy1uwmacj', 'davidevano18@gmail.com', '<p>                                                 Lamongan,28 April 2023</p><p>Kepada Yth:</p><p>Inspektur Kab. Lamongan</p><p>Jl. Basuki rahmat no.209</p><p>Lamongan</p><p><br></p><p>Perihal: Laporan</p><p><br></p><p>Yang bertandatangan dibawah ini:</p><p>Nama  : Bambang </p><p>Alamat: Klakahrejo Kel.Kandangan Kec.Benowo SBY</p><p>No. Hp: 081 330 635 766</p><p><br></p><p>Dengan ini menyampaikan pengaduan perihal permintaan sejumlah uang atas pelayanan pengantar perkawinan pada tanggal 27 maret 2023 di desa gempolmanis kec.sambeng kab.lamongan sejumlah rp.700.000,_ (tujuh ratus ribu rupiah)</p><p><br></p><p>Demikian surat ini kami sampaikan, atas perhatiannya saya ucapkan terimakasih.</p><p><br></p><p>                                                                 Hormat kami</p><p>                                                                 Bambang</p><p><br></p><p>Tembusan:</p><p>1. Bupati Lamongan</p><p>2. Ombutsman perwakilan Jatim</p>', NULL, 'Kantor desa Gempolmanis', 10, 2, 1, 0, 0, 1, '{\"1\":\"2023-04-28 14:35:47\",\"3\":\"2023-05-02 07:51:15\",\"5\":\"2023-05-02 08:07:07\",\"8\":\"2023-05-02 08:10:26\"}', '2023-04-28 07:35:47', '2023-05-02 01:10:26');
