(3644, 44, 5, 'Irban', 8, '<p>Terima kasih sudah menunggu, setelah kami konfirmasi ke Dinas Koperasi dan Usaha Mikro, dimohon untuk mencoba kembali karena nomor telp masih aktif tetapi terkadang ada kendala jaringan dan sudah dilaporkan ke pihak telkom, sedangkan untuk email yang masuk dan spam ke Diskopum ada ribuan jadi silakan dikirim ulang dengan menambahkan judul yang jelas.</p>', '2022-09-02 02:03:46'),
(3645, 44, 5, 'Irban', 8, '<p>Baik, Saran dan Kritik Bapak akan kami sampaikan ke Dinas Koperasi dan Usaha Mikro, semoga bisa sebagai bahan masukan untuk lebih baik kedepannya, maaf mungkin bisa di infokan kapan email Bapak dikirim dan bisa dilampirkan screenshot emailnya, terima kasih</p>', '2022-09-05 01:01:34'),
