(3651, 44, 5, 'Irban', 8, '<p>Terima kasih dan sudah kami sampaikan ke OPD terkait, mohon untuk menunggu dan Bapak bisa cek secara berkala emailnya, semoga bisa segera ditindaklanjuti oleh Diskopum dan mohon maaf Bapak Inspektur sudah purna tugas per tanggal 01 September 2022 sehingga kami kurang berkenan jika Bapak contact beliau, terkait fitur upload file pada aplikasi ini sudah disediakan, pada saat Bapak membuat laporan awal disana ada <em>upload lampiran</em> dan untuk <em>upload </em>pada kolom komentar kemungkinan sedang off karena sebagian sedang ada maintance, mohon untuk dimaklumi</p>', '2022-09-06 07:23:06'),
